  input: TEXT,F3XA,,"In response to the Request for Additional Information dated Jun
    04 2003, the Committee has Amended the 30 Day Post-General Report (10/17/02-11/25/02).
    The expenditure to 21st Century Democrats description 'reattr of Sheet MEtal Wrks
    Contrib' was in fact a reattribution of a Non-Federal contribution erroneously
    deposited to the Committee's Federal account on 9/24/02. Being that the error
    was discovered within 60 days of the original deposit, the funds were transferred
    from the Federal to the Non-Federal account. The transaction has been modified
    to show the recipient of the expenditure '21st Century Democrats-Non-Federal Acct.'.
    All Get Out The Vote expenditures were made for general activities on behalf of
    the entire Democratic ticket, no specific activities were engaged in on behalf
    of a Federal candidate. Therefore these are generic activities that are allocated
    as administrative/voter drive expenditures. The report has been modified to reflect
    the genereric nature of the expenditures."
